import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Profile from "./Profile";
import Benefits from "./Benefits";
import Auth from "./Auth";

// Компонент ChoiceSection, который нужно отобразить только на страницах /profile и /benefits
const ChoiceSection = () => (
  <div>
    {/* Ваш контент для ChoiceSection */}
    <p>Choice Section</p>
  </div>
);

// Компонент Header, который нужно отобразить только на страницах /profile и /benefits
const Header = () => (
  <div>
    {/* Ваш контент для Header */}
    <p>Header</p>
  </div>
);

// Основной компонент App
class App extends React.Component {
  render() {
    return (
      <Router>
        <Routes>
          <Route path="/profile/*" element={<Profile />} />
          <Route path="/benefits/*" element={<Benefits />} />
          <Route path="/auth/*" element={<Auth />} />
        </Routes>
      </Router>
    );
  }
}

export default App;
